    onLogout();
    navigate("/");
  };

  return (
    <div style={{ padding: 20 }}>
      <h1>Pantalla Principal</h1>
      <nav>
        <button onClick={() => navigate("/turnos")}>
          Ir a Formulario de Turnos
        </button>
        <button onClick={cerrarSesion} style={{ marginLeft: 10 }}>
          Cerrar Sesi√≥n
        </button>
      </nav>
    </div>
  );
}

export default Main;
